// src/pages/LandingPage.jsx
import React from 'react';
import Navbar from '../components/Navbar';
import HeroSection from '../components/HeroSection';

const LandingPage = () => {
  return (
    <div>
      <Navbar />
      <HeroSection />
    </div>
  );
};

export default LandingPage;
